import React from 'react'


function Contact(){
    return(
        <div>
            <h5 className = "font-weight-bolder">Like What You See?</h5>
            <div className = "margins contact">
                <br/>
                <p className="lead d-inline">Feel Free To</p> 
                <br/><br/>
                <a className="display-3 orange-gradient d-inline remove-color-hyperlink font-weight-bolder p-2" href="mailto:shashank.ginjpalli@gmail.com" target="_blank" rel="noopener noreferrer"> Contact Me</a>

                <br/><br/>
            </div>
        </div>
    );
}

export default Contact
